import Carrot from './carrots.jpg'

function ShopComponent() {
    return(
        <div className="component-conatiner">
            <div className="item-conatiner">
                <img src={Carrot} className='item-image'/>
                <div>
                    <div>
                        <div>Carrot</div>
                        <div>Rs.650 / 1kg</div>
                    </div>
                </div>
                <div>Grown in Nuwara Eliya, Sri Lanka</div>
            </div>
        </div>
    );
}
export default ShopComponent;
